The `f5distributedcloud_active_service_policies` resource manages Active Service Policies in F5 Distributed Cloud.

Active Service Policies allow you to activate and apply a set of service policies to sites or virtual sites.

## Example Usage

```hcl
resource "f5distributedcloud_active_service_policies" "example" {
  name      = "active-policies"
  namespace = "system"

  policies {
    name      = "rate-limit-policy"
    namespace = "my-namespace"
  }

  policies {
    name      = "waf-policy"
    namespace = "my-namespace"
  }
}
```

The `f5distributedcloud_app_type` resource manages App Types in F5 Distributed Cloud.

App Types define application characteristics and enable features like API discovery, sensitive data detection, and more.

## Example Usage

```hcl
resource "f5distributedcloud_app_type" "example" {
  name      = "my-app-type"
  namespace = "shared"

  features {
    type = "USER_IDENTIFICATION"
  }

  features {
    type = "API_DISCOVERY"
  }
}
```

The `f5distributedcloud_enhanced_firewall_policy` resource manages Enhanced Firewall Policies in F5 Distributed Cloud.

Enhanced Firewall Policies provide Layer 3/4 network security controls with advanced rule configurations.

## Example Usage

```hcl
resource "f5distributedcloud_enhanced_firewall_policy" "example" {
  name      = "enhanced-fw"
  namespace = "my-namespace"

  rules {
    name     = "allow-https"
    action   = "ALLOW"
    protocol = "TCP"
    dst_port = 443
  }

  rules {
    name   = "deny-all"
    action = "DENY"
  }
}
```

The `f5distributedcloud_forward_proxy_policy` resource manages Forward Proxy Policies in F5 Distributed Cloud.

Forward Proxy Policies define rules for controlling outbound traffic from applications through the F5 XC proxy.

## Example Usage

```hcl
resource "f5distributedcloud_forward_proxy_policy" "example" {
  name      = "my-proxy-policy"
  namespace = "my-namespace"

  proxy_rules {
    action       = "allow"
    domain_match = "*.example.com"
    port_match   = 443
    http_methods = ["GET", "POST"]
  }

  proxy_rules {
    action       = "deny"
    domain_match = "*.blocked.com"
  }
}
```

The `f5distributedcloud_log_receiver` resource manages Log Receivers in F5 Distributed Cloud.

Log Receivers configure destinations for forwarding logs from F5 XC to external systems.

## Example Usage

### HTTP Log Receiver

```hcl
resource "f5distributedcloud_log_receiver" "http" {
  name          = "http-logs"
  namespace     = "system"
  receiver_type = "HTTP"

  http_receiver {
    url        = "https://logs.example.com/ingest"
    auth_token = var.log_token
    batch_size = 100

    tls_config {
      skip_verify = false
    }
  }
}
```

### Syslog Receiver

```hcl
resource "f5distributedcloud_log_receiver" "syslog" {
  name          = "syslog-logs"
  namespace     = "system"
  receiver_type = "SYSLOG"

  syslog_receiver {
    address  = "syslog.example.com"
    port     = 514
    protocol = "UDP"
    format   = "RFC5424"
  }
}
```

The `f5distributedcloud_namespace_role` resource manages Namespace Roles in F5 Distributed Cloud.

Namespace Roles define permissions within a namespace, allowing fine-grained access control for resources and operations.

## Example Usage

```hcl
resource "f5distributedcloud_namespace_role" "viewer" {
  name        = "viewer-role"
  namespace   = "my-namespace"
  description = "Read-only access role for namespace resources"
  role_type   = "CUSTOM"

  permissions {
    resource   = "origin_pool"
    operations = ["read", "list"]
  }

  permissions {
    resource   = "http_loadbalancer"
    operations = ["read", "list"]
  }
}
```

The `f5distributedcloud_role` resource manages Roles in F5 Distributed Cloud.

Roles define permissions for accessing and managing resources within the F5 XC platform.

## Example Usage

```hcl
